        private void StepServicios(object sender, RoutedEventArgs e)
        {
            if (nextWindow != null) nextWindow.Show();

            if (nextWindow == null)
            {
                NuevaReservaServicios reservaServicioWin = new NuevaReservaServicios(this);
                reservaServicioWin.Show();

            }
            Hide();
        }

